GRAMICCI「グラミチ」Packable Shell Shorts「パックブルシェルショーツ」が新入荷！。片手で調整できるウエビングベルト、180度開脚可能なガゼットクロッチなどの仕様はそのままに、水辺やランニングや街中など、様々なシーンで活用できるショーツです。速乾性があり、パッカブルにもなるので持ち運びにも便利です。■素材：ポリエステル １００％
