■商品説明■<BR>
GRAMICCI「グラミチ」Packable Dot Shell Shorts[パックブルドットシェルショーツ]が新入荷！。片手で調整できるウエビングベルト、180度開脚可能なガゼットクロッチなどの仕様はそのままに、水辺やランニング、街中など、様々なシーンで活用できるショーツです。速乾性があり、パッカブルにもなるので持ち運びにも便利です。ドット柄がコーディネートのアクセントになります。■素材：ポリエステル 100%<br><br><br>
