GRAMICCI SHORTSをスッキリした細身なシルエットに改良！肌触りの良いストレッチ入のコットン地を使用したカモフラージュ柄のNN-SHORTSになります。快適にスマートにグラミチを堪能できる一本です！片手で簡単にサイズ調節ができるウェビングベルトを使用し、股下は180度開脚可能なガゼットクロッチ。これが快適性と足運びの良さを実現します。■素材：コットン ９７％ ポリウレタン ３％<br><br><br>
